Га́бсбурги (нем. Habsburger) — одна из наиболее могущественных монарших династий Европы на протяжении Средневековья и Нового времени. Представители династии известны как правители Австрии (c 1282 года), трансформировавшейся позднее в многонациональную Австро-Венгерскую империю (до 1918 года), являвшуюся одной из ведущих европейских держав, а также как императоры Священной Римской империи, чей престол Габсбурги занимали с 1438 по 1806 годы (с кратким перерывом в 1742—1745 годах) Помимо Австрии и Священной Римской империи, Габсбурги также были правителями следующих государств: 
*  Венгрии в 1437—1439, 1445—1457, 1526—1918 годах; 
*  Чехии в 1306—1307, 1437—1439, 1453—1457, 1526—1618, 1621—1918 годах; 
*  Хорватии в 1437—1439, 1445—1457, 1526—1918 годах; 
*  Испании в 1516—1700 годах; 
*  Португалии в 1580—1640 годах; 
*  Неаполитанского королевства в 1516—1735 годах; 
*  Мексики в 1864—1867 годах; 
*  Трансильвании в 1690—1867 годах; 
*  Тосканы в 1790—1859 годах; 
*  Пармы в 1814—1847 годах; 
*  Модены в 1814—1859 годах. а также целого ряда более мелких государственных образований.
